import React, {useState} from "react";
  import Todo from './Todo'
  import Submit from './Submit'
function App (){
	const [data, setdata] = useState(
	[
	{content:"buy food", id:1},
	{content:"buy cloths", id:2},
	{content:"play game", id:3}
	]
	);
	
	const adding =(add) =>{
		add.id = Math.random();
		const newlist = [...data, add];
		setdata(newlist);
		
	}
	
	
	
	
	
		return(
		<div>
		<h1> Todo's </h1>
		<Todo data={data}/>
		<Submit adding={adding}/>
		</div>
		
		)
		
		
		
	}
	
	




 export default App
